import axios from "axios";


export function loadHistory(){
    return(dispatch)=>{
        return axios.get("http://localhost:8080/getReactAssigFormData/sarthak.mehta@aurigait.com").then((response)=>{
            dispatch(changeHistory(response.data.data));
        })
    }
}
export function changeHistory(history){
    return{
        type:"CHANGE_HISTORY",
        history:history
    }
}
